INSERT INTO `listings` VALUES (3,'Tensorium AI Thread Contest','We are seeking a well-crafted Twitter thread to drive engagement and share valuable insights onTensorium AI ($TNSR). The thread should be designed to inform, captivate, and resonate with the target audience. This opportunity is perfect for creators with a knack for storytelling and a deep understanding of Twitter\'s dynamic platform.','2024-12-19T16:15:15.000Z','init',6,2,'bounty','{\"token\":\"USDC\",\"prizes\":[250, 100, 100],\"bonusPrize\":{\"number\":\"\",\"amount\":\"\"}}','<p>The Twitter thread should adhere to the following guidelines:</p><ul><li><strong>Purpose:</strong> Inform the audience about Tensorium AI ($TNSR), highlight achievements, products, or initiatives, and educate, entertain, or inspire.</li><li><strong>Structure:</strong> Begin with a powerful hook that sets the context. Use concise language, avoiding jargon unless necessary. Each tweet should present a standalone idea yet connect seamlessly with the rest.</li><li><strong>Tone and Style:</strong> The tone can be [professional, conversational, humorous, or motivational]. Maintain authenticity while aligning with the brand voice of Tensorium AI</li><li><strong>Brand Integration:</strong> Ensure the thread subtly promotes the brand (e.g., by mentioning achievements, case studies, or unique offerings). Include links to Telegram, Website, DEX</li><li><strong>Optional Additions:</strong> A supporting graphic, video, or infographic can be provided to boost visual appeal. Include any data sources, credits, or references if necessary.</li></ul><h2>Evaluation Criteria</h2><p>All submissions will be evaluated based on the following criteria:</p><ul><li><strong>Relevance:</strong> Alignment with the topic/theme and brand objectives.</li><li><strong>Engagement:</strong> The thread\'s ability to captivate and hold the audience\'s attention.</li><li><strong>Clarity:</strong> Clear and concise communication of key insights and messages.</li><li><strong>Creativity:</strong> Innovative storytelling techniques and originality in presenting the content.</li><li><strong>Accuracy:</strong> Data integrity, correctness of insights, and logical flow.</li><li><strong>Visuals:</strong> Effective use of visuals, if included, to complement the narrative.</li><li><strong>Impact:</strong> Measured by actionable takeaways and the strength of the call-to-action (CTA).</li></ul>','',NULL,'twitter_thread_creation','Community Builder,Copywriter,Content Creator','0xskan@gmail.com','Content','[\"Follow @TensoriumAI \",\"Tag $TNSR and @TensoriumAI\",\"Talk about the dev x.com/ShannonNullCode\",\"Include Contract Address CA\"]','[\"A complete Twitter thread consisting of 4-10 tweets, following the format and flow outlined below:\",\"Hook/Opening that grabs attention.\",\"Key insights, storytelling, or data presented in a sequential, engaging manner.\",\"Talk About Shannon Code (The dev)\",\"Closing tweet with a clear call-to-action (CTA).\",\"Incorporation of $TNSR\",\"A cohesive narrative that aligns with the brand tone and message of Tensorium AI\",\"Optional: Visuals such as charts, images, or memes to enhance engagement, Cookie.fun...etc\"]',NULL,'2024-12-27',NULL,'tensorium_ai_thread_contest',1),(4,'Interact with Hustle ($TNSR)','$TNSR - @TensoriumAI agent Hustle is finally LIVE. Interact with him, share on X and win prizes.','2025-01-09T08:00:14.000Z','init',6,2,'bounty','{\"token\":\"USDC\",\"prizes\":[150,100,100,50,50],\"bonusPrize\":{\"number\":\"\",\"amount\":\"\"}}','<p>$TNSR - @TensoriumAI agent Hustle is finally LIVE. Interact with him, share on X and win prizes.</p><p><br></p><p>In order to be eligible for the prize:</p><p><br></p><p>‚Ä¢ Interact with Agent Hustle on agenthustle.ai</p><p>‚Ä¢ Record your experience and post it on X</p><p>‚Ä¢ Include ticker $TNSR and tag @TensoriumAI</p><p><br></p><p>Make sure to:</p><p><br></p><p>‚Ä¢ Deliver a creative way of interacting with Agent Hustle</p><p>‚Ä¢ Explain the content</p><p>‚Ä¢ Upload Quality Content</p><p>‚Ä¢ No basic interactions (ex: Hi, how are you Hustle?)</p><p><br></p>','global',NULL,'empty','Content Creator','0xskan@gmail.com','Content','[\"Interact with Agent Hustle on agenthustle.ai\",\"Record your experience and post it on X\",\"Include ticker $TNSR and tag @TensoriumAI\"]','[\"A creative way of interacting with Agent Hustle\",\"Explain the content\",\"Quality Content\",\"No basic interactions (ex: Hi, how are you Hustle?)\"]',NULL,'2025-01-13',NULL,'interact_with_hustle_tnsr',1),(8,'Tech Tales with Bhopal DAO - Instagram Reel Mega Contest','The goal of this contest is to create short, impactful Instagram Reels that simplify crypto and AI concepts, making them accessible to beginners. We\'re looking to flood Instagram with quality, educational content that demystifies these topics and engages the community.','2025-01-20T08:16:28.000Z','init',265,11,'bounty','{\"token\":\"USDC\",\"prizes\":[300,250,200,150,100],\"bonusPrize\":{\"number\":\"5\",\"amount\":\"20\"}}','<ol><li><strong>Original Content Only:</strong> All reels must be your own original creation. Reposts or copied content will be disqualified</li><li><strong>Public Profile Required:</strong> Make sure your Instagram profile is set to public so we can view your submission</li><li><strong>One Submission Per Participant:</strong> Only one reel submission is allowed per participant</li><li><strong>Submission:</strong> After posting your reel, submit the post link here.</li><li><strong>Tag and Hashtag:</strong> Tag <em>@bhopal_dao</em> on Instagram and (optionally) use <em>#TechTalesWithBhopalDAO</em> in your caption</li><li><strong>Follow Us:</strong> Follow <em>@bhopal_dao</em> on Instagram: <a href=\"https://www.instagram.com/bhopal_dao\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: inherit;\">Instagram Link</a></li><li><strong>Join Our Community:</strong> Join the Bhopal DAO Telegram group for updates and networking: <a href=\"https://t.co/BhopalDAO\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: inherit;\">Telegram Group</a></li><li><strong>Judging Criteria:</strong> Creativity, originality, relevance to the theme, and overall engagement will be considered</li><li><strong>Prizes:</strong> Winners will receive over $1100 worth of rewards, including exclusive hoodies and merch.</li><li><strong>Support:</strong> For any queries or updates, reach out to us on our <a href=\"https://t.me/BhopalDAO\" rel=\"noopener noreferrer\" target=\"_blank\">Telegram community</a></li></ol><p><br></p>','global',NULL,'empty','Content Creator,Campaign Manager','t.me/BhopalDAO','Content','[\"Create an original, ready-to-post reel (15‚Äì60 seconds) on any of the contest topics.  \",\"Post the REEL on your Public Instagram Account.\",\"Tag @bhopal_dao on Instagram and add a Caption w/- #TechTalesWithBhopalDAO.\",\"Submit your post link through the Wizz HQ Submission Form.\",\"For any query and support, join Bhopal DAO TG. \"]','[\"Must be an original reel created by you\",\"Participants follow @bhopal_dao on Instagram(optional)\",\"Join the Bhopal DAO Telegram community\",\"Instagram profile must be public for us to view the submission\",\"Tag @bhopal_dao on Instagram and add a Caption w/- #TechTalesWithBhopalDAO\"]',NULL,NULL,NULL,'tech_tales_with_bhopal_dao___instagram_reel_mega_contest',1),(9,'P2PMe - Pay with USDC','The goal of this contest is to create a thread on X explaining the use of P2PMe while making a payment at a UPI enabled vendor, either by scanning the QR Code or by entering a UPI ID. Video of making the payment will be highly preferred. Special effects on the video is optional, but if used must convey a good story.\n\n\n','2025-01-17T10:01:13.000Z','init',408,18,'bounty','{\"token\":\"USDC\",\"prizes\":[250,100,100],\"bonusPrize\":{\"number\":\"\",\"amount\":\"\"}}','<h1><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Detailed Description</span></h1><ol><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">User can be an existing user of P2P.Me or a new user;&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">New users should request RP on </span><a href=\"https://docs.google.com/forms/d/e/1FAIpQLScY5jGj5k5xcg6AWjb0sEMusUjwYAu04BObpQ7TPRNV3DEYCw/viewform\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(17, 85, 204);\">this form</a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">. In the form, please mention ‚ÄúWizzHQ - P2PMe Pay with USDC Contest‚Äù in the field with the question ‚ÄúReferred by Someone? Let us know who!‚Äù&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">In case of delay in receiving RP from the above form, a new user can DM either @VibesMasteru or @KidWinTinker for the necessary RP.</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Participants in the contest will be responsible for on-ramping (adding USDC to their wallet) by themselves and spending it on any item of their choosing. Funds will not be provided by P2PMe or Wizz HQ</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Users can buy any item of their choice as long as they use P2PMe to pay for it. Users will be required to provide evidence of such purchase through P2PMe. Video evidence will be strongly preferred</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">As evidence of payment with P2PMe, we will require the order number which we will ask for if you are selected as the winner. To see the order number, you can view the activity tab in the P2PMe app.</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Payment usually takes between two minutes and five minutes to occur. In case, payment does not occur feel free to message on the Telegram group asking for support. Provide your Order ID for which the Telegram</span></li><li><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">To access the scanner for the UPI ID, click on the Sell USDC button and enter the amount in INR</strong></li></ol><p><br></p><h1><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Judging Criteria</span></h1><p><br></p><ol><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Video evidence of payment is of paramount importance;&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Videos need not be edited with sound effects or any other kinds of editing, but if so, then the sound effects should match the story and the emotions being portrayed;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Tweets that gain more views will be given a higher weightage;&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Tweets that gain more bookmarks will be given a higher weightage;&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Tweets that gain the attention of any prominent influencer on Crypto Twitter on </span><a href=\"https://abounding-buttercup-01c.notion.site/KOLs-1735264beeb28030a5abe0569493f4e3\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(17, 85, 204);\">this list</a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">, causing them to Retweet, Quote Tweet and try out the product themselves will also receive additional consideration</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">The more unique the use case and the story behind it, the higher your consideration will be for the bounty</span></li><li>The participant who portrays the most interesting use-case of payments with USDC, will receive high consideration. Here are some examples of items that have been purchased with P2PMe: </li></ol><p><br></p><p>Lunch at a restaurant - (eg. Biryani)</p><p>Caps and T-Shirts</p><p>Tea and Coffee</p><p>Cigarettes</p><p>Juice</p><p>Groceries</p><p>Movie Tickets</p><p><br></p><h1><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Frequently Asked Questions around P2PMe</span></h1><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Do I need KYC to use P2PMe?</strong></p><p><br></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">No. A zkKYC is optional. Doing so will allow you to increase your transaction limits. If you choose to submit your zkKYC, then the Indian government will be able to see your Aadhar ID on chain, but no one else will be able to see it. If you choose not to submit it, then you will simply remain private forever.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">On which Blockchain is P2PMe built?</strong></p><p><br></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">P2PMe is built on Base. The team has plans to expand this to other Blockchains in the future.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">How does P2PMe address the bank freeze issue?</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Bank freezes usually occur as a result of a fraudster‚Äôs bank accounting transacting with someone else‚Äôs bank account. P2PMe‚Äôs RP system is designed to prevent fraudsters from using the app and engaging with the merchants.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Recommending a fraudster on the platform will also result in loss of RP for the user. For example, if you recommend a fraudster on P2PMe, then you will also lose RP when the fraudster is caught. Users should only recommend people that they know and trust.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">What is RP?&nbsp;</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">RP stands for reputation points. Your reputation points determine your limit per transaction.&nbsp;</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">How many transactions can I do in one day?</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">You can perform 3 onramps (buy USDC) and 10 offramps (sell USDC) in one day. Additionally, you can do a maximum of 15 onramps in a given month.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Does P2PMe support any other payment infrastructure other than UPI?</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">&nbsp;</span></p><p><br></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">No.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">How does P2PMe provide liquidity?</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">P2PMe has a merchant network where each merchant is required to stake 500 USDC on the platform.&nbsp;</span></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">What happens in case of a dispute? What happens if I pay in INR but don‚Äôt receive USDC? What happens if I pay in USDC but don‚Äôt receive INR?</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">P2PMe uses a zkTLS stack powered by Reclaim Protocol to adjudicate disputes. It involves matching the alleged onchain transaction with the UPI transaction. The zk-TLS technology is used to prove whether a UPI transaction took place or not. In case of a dispute while onramping, the user will be required to provide the last four digits of their UPI transaction ID and using a ZKScan of their bank account, the user will prove they made the INR payment and didn‚Äôt receive the USDC.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">In case of a dispute while offramping, the user will provide the transaction has on the Base Blockchain and the merchant will be required to prove that they made the relevant payment through INR.&nbsp;</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">In case of a dispute, if the merchant is found guilty he/she will lose the 500 USDC that they have staked on the platform. If a user is found guilty then they will lose their RP.</span></p><p><br></p><p><br></p>','india',NULL,'empty','Content Creator,Web3 Educator','https://x.com/P2Pdotme','Content','[\"Follow @P2PdotMe on X\",\"Must join the P2PMe TG Community: https://t.me/P2Pdotme\",\"Must have their own UPI ID and bank account\",\"Bank account should have clean source of funds and no history of fraud/freeze\",\"The participant must be from India\"]','[\"4-10 tweets per thread\",\"Hook/opening that grabs attention\",\"Key, insights and storytelling in a sequential manner\",\"One of the tweets should be a short video using P2P.Me for payments using either a UPI ID or a UPI QR Code as one of the tweets (Less than five minutes)\"]',NULL,NULL,NULL,'p2pme___pay_with_usdc',1),(10,'OnlyCalls Bounty Blitz: Impress the AI agent','Create an engaging Twitter thread growing use-cases of AI agents in crypto, particularly tokens. (plug-in OnlyCalls) And win 4.2069M OnlyCalls Tokens!','2025-01-23T10:41:45.000Z','init',451,19,'bounty','{\"token\":\"CALL\",\"prizes\":[4206900],\"bonusPrize\":{\"number\":\"\",\"amount\":\"\"}}','<h1><strong>üöÄ OnlyCalls Bounty Blitz: Impress the AI agent üöÄ</strong></h1><h1><br></h1><h2><strong>üí∞ Prize Pool: 4.2069M OnlyCalls Tokens! üí∞</strong></h2><p><br></p><p>Unleash your creativity and explore the transformative power of AI agents. Here\'s how you can</p><p>participate and win!</p><p><br></p><h3><strong>Contest Details:</strong></h3><h3><br></h3><p>What: Create an engaging Twitter thread growing use-cases of AI agents in crypto,</p><p>particularly tokens.</p><p><br></p><h3><strong>Prize Distribution:</strong></h3><h3><br></h3><p>Our AI-powered agent will evaluate submissions based on:</p><p>‚óè Creativity and originality.</p><p>‚óè Engagement metrics (likes, retweets, comments).</p><p>‚óè Relevance to AI and OnlyCalls. Base and virtuals ecosystem</p><p><br></p><p>Our AI agent will interact with your post to evaluate its contribution to the community, assessing</p><p>how insightful, unique, and impactful it is. Based on this evaluation, you could earn a bounty of</p><p>up to 4.2069M OnlyCalls Tokens.</p><p><br></p><h3><strong>Possible Topics(plug-in OnlyCalls):</strong></h3><p><br></p><p>‚óè How to get alpha in this saturated market</p><p>‚óè The best AI agents under 5M,10M market cap</p><p>‚óè Compare ONLYCALLS with its existing nearby market-cap AI agents</p><p>‚óè Strategies for identifying undervalued assets</p><p>‚óè The Role of Sentiment Analysis in Investment Decisions</p><p>‚óè The Future of AI in Investment Management</p><p>‚óè Top 5 on-chain AI funds</p><p>‚óè AI-Driven Arbitrage Strategies in Crypto Markets</p><p>‚óè Exploring Micro-Cap AI Projects with High Growth Potential</p><p>‚óè Evaluating Risk-Reward Ratios of Emerging AI Tokens</p><p>‚óè AI-Powered Solutions for DeFi Protocol Optimization</p><p>‚óè Impact of AI Agents on On-Chain Governance and Voting</p><p>‚óè Comparison of AI-Enhanced NFT Marketplaces in the Same Market Cap Range</p><p>‚óè How AI Agents Are Revolutionizing Tokenomics and Distribution Models</p><p>‚óè Quantifying the ROI of Sentiment-Driven Trading Algorithms</p><p>‚óè Top AI Protocols for Analyzing Historical On-Chain Data</p><p>‚óè AI vs. Human: Performance Comparison in Crypto Investment Strategies</p><p><br></p><h3><strong>Reference:</strong></h3><p><br></p><p><a href=\"https://linktr.ee/Onlycallsdotfun\" rel=\"noopener noreferrer\" target=\"_blank\">https://linktr.ee/Onlycallsdotfun</a></p><p><a href=\"https://x.com/0xOnlyCalls\" rel=\"noopener noreferrer\" target=\"_blank\">https://x.com/0xOnlyCalls</a></p><p><a href=\"https://onlycalls.fun/\" rel=\"noopener noreferrer\" target=\"_blank\">https://onlycalls.fun/</a></p>','global',NULL,'empty','Content Creator','https://x.com/0xOnlyCalls','Content','[\"Your thread must tag @0xOnlyCalls.\",\"The OnlyCalls AI Agent will decide your reward from the prize pool.\",\"The AI Agent will DM you to request your wallet address for prize distribution.\",\"The prize pool will be distributed among participants in varying amounts, depending on several factors.\",\"Prizes will be distributed on a rolling basis until the bounty pool is exhausted.\",\"Multiple entries are allowed.\",\"You do not need to submit your entry manually. Simply tag @0xOnlyCalls, and the AI Agent will find your entry automatically.\"]','[\"Write a thread with at least 5 tweets highlighting AI agents\' features, benefits, and uses in crypto-space, particularly tokens. \",\"Tag @0xOnlyCalls in your thread.\"]',NULL,NULL,NULL,'onlycalls_bounty_blitz_impress_the_ai_agent',1);
